import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import Cookies from 'js-cookie'; // Corrected: Use js-cookie for consistency

// Corrected import names to match component file names
import About from './components/About';
import History from './components/History';
import LoginForm from './components/LoginForm';
import ProtectedRoute from './components/ProtectedRoute'; // Re-using existing ProtectedRoute
import TaxUploader from './components/TaxUploader'; // Assumed component for 'start' or 'documents'
import Register from './components/Register'; // Assuming Register component exists
import ContactUs from './components/ContactUs'; // Assuming ContactUs component exists
import Home from './components/Home'; // Assuming Home component exists

import './App.css'; // Your main App CSS

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [username, setUsername] = useState('');

  useEffect(() => {
    // Check for token on component mount using js-cookie
    const token = Cookies.get('jwt_token');
    // For username, you might need to fetch it from backend or store it similarly if needed globally
    // For now, let's assume username isn't directly persisted in cookie, but can be retrieved on login.
    // If you need username to persist, you'd store it in a cookie too, or fetch it on app load if authenticated.
    // For this example, I'll remove direct username persistence in the cookie for simplicity.
    // If you need it, add: const storedUsername = Cookies.get('username');
    if (token) {
      setIsAuthenticated(true);
      // setUsername(storedUsername || ''); // Set username if it was stored
    }
  }, []);

  const handleLogin = (token, user) => {
    Cookies.set('jwt_token', token, { expires: 30, path: '/' }); // Set cookie
    // If you want to store username in cookie: Cookies.set('username', user, { expires: 30, path: '/' });
    setIsAuthenticated(true);
    setUsername(user);
  };

  const handleLogout = () => {
    Cookies.remove('jwt_token'); // Remove cookie
    // If you stored username in cookie: Cookies.remove('username');
    setIsAuthenticated(false);
    setUsername('');
  };

  return (
    <Router>
      <div className="App">
        {/* Header component handles its own authentication-based link rendering */}
        {/* We pass handleLogout down if Header needs to trigger it, or Header can get it from context/cookie directly */}
        {/* Header component is already integrated in About, Home, History, TaxUploader and LoginForm */}
        {/* So, removed from here, as it's typically rendered within each page */}
        
        <div className="main-content">
          <Routes>
            <Route path="/register" element={<Register />} />
            {/* Pass handleLogin to LoginForm to update App's state */}
            <Route path="/login" element={<LoginForm onLogin={handleLogin} />} /> 
            <Route path="/about" element={<About />} /> {/* Public About page */}
            <Route path="/contactus" element={<ContactUs />} /> {/* Public Contact Us page */}
            <Route path="/home" element={<Home />} /> {/* Public Home page */}

            {/* Protected Routes - using the ProtectedRoute component */}
            <Route
              path="/start" // Route for initiating tax upload
              element={
                <ProtectedRoute>
                  <TaxUploader />
                </ProtectedRoute>
              }
            />
            <Route
              path="/history"
              element={
                <ProtectedRoute>
                  <History />
                </ProtectedRoute>
              }
            />
            {/* Redirect root to /home if not authenticated, otherwise to /start (TaxUploader) */}
            <Route
              path="/"
              element={isAuthenticated ? <Navigate to="/start" /> : <Navigate to="/home" />}
            />
             {/* Fallback route for unmatched paths */}
            <Route path="*" element={<NoMatch />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

// Basic NoMatch component for 404
const NoMatch = () => (
  <>
    <Header /> {/* Render Header for consistency */}
    <div style={{ textAlign: 'center', marginTop: '50px', fontSize: '1.5em', color: '#dc3545' }}>
      <h2>404 - Page Not Found</h2>
      <p>The page you are looking for does not exist.</p>
      <Link to="/" style={{ color: '#007bff', textDecoration: 'none', fontWeight: 'bold' }}>Go to Home</Link>
    </div>
  </>
);

export default App;
